CREATE FUNCTION public.generate_invoice(order_id integer) RETURNS void
    LANGUAGE plpgsql
    AS $$
DECLARE
    total_amount NUMERIC(10, 2); -- A rendelés teljes összege
BEGIN
    -- Számítsd ki a rendelés teljes összegét
    SELECT SUM(oi.quantity * b.price) INTO total_amount
    FROM order_items oi
    JOIN books b ON oi.book_id = b.id
    WHERE oi.order_id = order_id;

    -- Hozz létre egy új számla bejegyzést
    VALUES (order_id, total_amount, CURRENT_TIMESTAMP);

    -- Jelöld meg a rendelést teljesítettként
    UPDATE orders
    SET status = 'Completed'
    WHERE id = order_id;

    RAISE NOTICE 'Invoice generated for order % with total amount %', order_id, total_amount;
END;
$$;


