CREATE FUNCTION public.monthly_sales_report() RETURNS TABLE(month text, total_orders integer, total_sales numeric)
    LANGUAGE plpgsql
    AS $$
BEGIN
    RETURN QUERY
    SELECT 
        TO_CHAR(o.order_date, 'YYYY-MM') AS month,
        COUNT(o.id) AS total_orders,
        COALESCE(SUM(oi.quantity * b.price), 0) AS total_sales
    FROM orders o
    LEFT JOIN order_items oi ON o.id = oi.order_id
    LEFT JOIN books b ON oi.book_id = b.id
    GROUP BY TO_CHAR(o.order_date, 'YYYY-MM')
    ORDER BY month;
END;
$$;


