CREATE FUNCTION public.update_book_availability() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    -- Ellenőrizd a könyv készletét, és frissítsd az "is_available" oszlopot
    UPDATE books
    SET is_available = CASE
                           WHEN stock - NEW.quantity <= 0 THEN FALSE
                           ELSE TRUE
                       END,
        stock = stock - NEW.quantity
    WHERE id = NEW.book_id;

    RETURN NEW;
END;
$$;


